import { useCallback, useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import styles from "./Frame3.module.css";

const Frame3 = () => {
  const navigate = useNavigate();

  const onRectangleImage3Click = useCallback(() => {
    navigate("/frame-6");
  }, [navigate]);

  const [orderData, setOrderData] = useState([]);

  useEffect(() => {
    // Fetch order data from the server
    fetch('/api/orders') // Replace with your server's API endpoint
      .then((response) => {
        if (!response.ok) {
          throw new Error('Network response was not ok');
        }
        return response.json();
      })
      .then((data) => {
        setOrderData(data);
      })
      .catch((error) => {
        console.error('Error fetching orders:', error);
      });
  }, []);

  return (
    <div className={styles.rectangleParent}>
      <img className={styles.frameChild} alt="" src="/rectangle-9@2x.png" />
      <div className={styles.date}>{`Date:      `}</div>
      <img className={styles.frameInner} alt="" src="/rectangle-11@2x.png" />
      <img
        className={styles.rectangleIcon}
        alt=""
        src="/rectangle-10@2x.png"
        onClick={onRectangleImage3Click}
      />
      <div className={styles.orderSummary}>Order Summary</div>
      <div className={styles.checkout}>CHECKOUT</div>
      <div className={styles.subtotal}>Subtotal</div>
      <div className={styles.lineDiv} />

      <table className={styles.frameChild}>
        <thead>
          <tr>
            <th>Name</th>
            <th>Quantity</th>
            <th>Price</th>
          </tr>
        </thead>
        <tbody>
          {orderData.map((order, index) => (
            <tr key={index}>
              <td>{order.name}</td>
              <td>{order.quantity}</td>
              <td>{order.price}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default Frame3;
